import React from "react";
import "./style.css";

function Footer() {
  return (
    <footer className="footer">
      <span>Harrison Blackburn: Full Stack Web Development | blackbhr@yahoo.com | <a href="https://github.com/harrisonblackburn">Github</a> |<a href="https://www.linkedin.com/feed/">LinkedIn</a></span>
    </footer>
  );
}

export default Footer;
